import React from 'react';
import { Typography, Box } from '@mui/material';

const Home = () => {
    return (
        <Box>
            <Typography variant="h4" gutterBottom>
                Welcome to MemeCoin
            </Typography>
            <Typography variant="body1">
                Create and share your memes!
            </Typography>
        </Box>
    );
}

export default Home;
